import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the profile button using class selector
    await page.waitForSelector('.profile-btn');
    await page.click('.profile-btn');
    await page.waitForTimeout(1000); // Wait for modal to appear

    // Take screenshot after clicking profile button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_clicked.png'));

    // Click the "Edit profile" button using ID selector
    await page.waitForSelector('#profileModal .edit-profile-btn');
    await page.click('#profileModal .edit-profile-btn');
    await page.waitForTimeout(1000); // Wait for edit profile interface to load

    // Take final screenshot after clicking "Edit profile"
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_edit_profile_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_edit_profile_opened.png'));

    // Verify that the edit profile interface is displayed
    const isEditProfileVisible = await page.isVisible('#profileModal .edit-profile-form');

    return {
      success: true,
      action: "Successfully navigated to the edit profile interface",
      extractedData: { editProfileVisible: isEditProfileVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
